import React from "react";
import Panel from "./panel";

const Dashboard = () => {
  return (
    <div className="dshbrd-1">
      <Panel w="3" h="3" convex={true}></Panel>
      <Panel w="2" h="3" concave={true} row={false}>
        <Panel w="2" convex={true}></Panel>
        <Panel w="2" convex={true}></Panel>
        <Panel w="2" concave={true}></Panel>
      </Panel>
      <Panel w="4" h="3" convex={true}></Panel>
      <Panel w="1" h="3" convex={true}></Panel>
      <Panel w="3" h="3" concave={true}></Panel>
      <Panel w="5" h="3" convex={true}></Panel>
    </div>
  );
};

export default Dashboard;
